  JWILLIAMS, Peter William Gerard and HOLDEN, Mary Louise Phyllis
  a
  03> WILLIAMS, Richard Paul Holden
  b 19.11.1971
  Richard b. at Hastings. Address: Waipoapoa Station, RD 12, Havelock North.
  Richard was educated at Hereworth School (1982-84) and Christ's College (1985-89) then obtained a
  Diploma of Farm Management from Lincoln University. He has recently returned from overseas and is
  working at "Waipoapoa" station, Havelock North.
  02> WILLIAMS, Wendy Esme Gerard m on 30.10.1963 to FALLOON, John Gavin
  b 12.07.1938
  b 15.12.1929
  Wendy b. at Gisborne and m. at Puketapu. Gavin, s/o Henry and Evelyn Falloon. Address: "Taumaru", RD 4,
  Longbush, Masterton.
  Wendy was educated at Woodford House, Havelock North. She has served as President of the Wairarapa Save
  the Children Fund, is on the Vestry of St Mark's Church, Carterton and is recording oral history.
  Gavin is Chairman of Waigroup Angus and farms cattle, sheep and deer. He recently won the Jubilee
  Bronze Medal from the NZ Society of Animal Production for services to animal breeding.
  01> FALLOON, Anna Louise m on 25.03.1989 to CASSIE, Morris James
  b 01.12.1964
  b ** ** ****
  Anna b. at Masterton and m., at St Mark's Church, Carterton. She was educated at Woodford House,
  Havelock North and has a BagSc from Lincoln. She is now working for Westpac Bank in Sydney.
  02> FALLOON, Tessa Wendy
  b 20.10.1966
  Tessa b. at Masterton. She was educated at Woodford House and has a BA in History and a BA in
  Psychology from Victoria University.
  03> FALLOON, Henry Peter William
  b 08.05.1970
  Henry was educated at Wanganui Collegiate School. He is currently farming.
  04> FALLOON, William Paul Elliott
  b 30.04.1972
  William was educated at Wanganui Collegiate School. He is currently farming.
  03> WILLIAMS, Robyn Priscilla m on 14.07.1966 to ASHLEY -WILSON, Roger Richmond
  Gerard
  b 05.10.1941
  b 26.09.1933
  Robyn b. at Gisborne. Divorced. Address: 12 Dingle Road, St Heliers, Auckland.
  Robyn grew up in Hawkes Bay, was educated at Woodford House and trained as a librarian. She moved to
  Auckland in 1964 and worked as a librarian at Auckland Grammar School for 10 years. In 1989 she
  retrained to become a teacher of English to foreign students and is currently working in that area.
